swaptrade_swap_dialog_desc_bridge_risk:
Služba {thirdParty} (dále jen „třetí strana“) agregovaná ve službě OKX Peněženka (dále jen „společnost OKX“) je centralizovaný most, který se řídí pouze podle vlastních podmínek poskytování služeb. Společnost OKX nemá s touto třetí stranou žádnou vazbu ani nijak neřídí její operace. Společnost OKX neposkytuje v souvislosti s obsahem a službami této třetí strany žádné záruky.

Souhlasíte s tím a berete na vědomí, že: (a) společnost OKX neodpovídá za žádné ztráty, škody ani jiné důsledky vašeho použití této třetí strany, včetně {freezeContent};
(b) společnost OKX nebude odpovídat na žádné stížnosti ani spory související s vaším použitím třetí strany a případné stížnosti a spory s třetí stranou budete řešit přímo na adrese {thirdPartyContact}.

swaptrade_modal_desc_crosschain_valuedif:
Poplatky zahrnuté do rozdílu hodnot tohoto cross-chainového swapu jsou:
• Poplatek za cross-chainové přemostění: {bridgePriceAndFee}
• Síťový poplatek v cílovém blockchainu: {toChainPriceAndFee}
• Pokud obchodujete s určitým objemem tokenů, má to dopad na hloubku likviditního fondu. Tím se následně změní celková dostupnost a cena tokenů, což vede k viditelným rozdílům v ceně.

swaptrade_mid_dialog_desc_est_network_fe:
Při cross-chainových transakcích tento poplatek zahrnuje síťové poplatky ze sítě platebního tokenu a za cross-chainový most.

Poplatek u této transakce se tvoří takto:
· Síťový poplatek v síti {chain}: {value1}
· Síťový poplatek za most {bridge}: {value2}

Síťové poplatky představují platby těžařům – neúčtujeme si je my.

swaptrade_intro_dialog_desc_cross_value_:
Rozdíl hodnot u této transakce se zobrazí takto:
· Síťový poplatek v blockchainu {chain}: {value1}
· Poplatek za most {bridge}: {value2}

Pokud je rozdíl hodnot mnohem větší, i když jsou výše uvedené poplatky relativně nízké, je příčinou to, že swapovaná částka ovlivnila hloubku likviditního fondu u tohoto tokenového páru.

swaptrade_intro_tooltip_trade_including_:
Náklady při cross-chainových swapech zahrnují transakční poplatek z blockchainu, z něhož platba odchází, a část z poplatku za cross-chainový most. Rozpis poplatků u této transakce:
• Síťový poplatek: {fromChainPriceAndFee}
• Poplatek za cross-chainový most: {bridgePriceAndFee}
Síťový poplatek se používá k pokrytí nákladů na těžaře a neúčtuje si jej naše platforma.

swaptrade_dialog_subtitle_agree_acknowle:
Souhlasíte s tím a berete na vědomí, že:
(a) společnost OKX neodpovídá za žádné ztráty, škody ani jiné důsledky vašeho použití mostu SWFT, včetně {swftFreeze};
(b) společnost OKX nebude odpovídat na žádné stížnosti ani spory související s vaším použitím mostu SWFT. Případné stížnosti a spory budete řešit přímo se společností SWFT ({swftLink}).
